window.bookSummaryJSON = "<p><b>The librarian and the prince...</b></p> <p>Clara is an Obligate, an indentured servant of the fae. If she ever wants to see home again, she must survive ten more years of servitude, developing her newly-discovered magic and battling powerful nightmare monsters in the Doomed City Library. She can’t afford any distractions. Distractions like Danny—her handsome childhood sweetheart—who longs to free her from her Obligation. Or Lord Ivor—the devastatingly beautiful fae lord—who desires to whisk her away to his own bright court of intrigue and danger.</p> <p>Most of all, she won’t be distracted by the complicated and intriguing Prince of the Doomed City, who may not be the enemy she’s always believed him to be.</p> <p>Continue this dark and twisted tale of brave librarians, deadly grimoires, and living nightmares. If you’re looking for breathtaking adventure, spine-chilling thrills, and a healthy dose of slow-burn romance, this is the series for you!</p>"; 
